//256-pt FFT
/*----------------------------------------------------------------------------
 * CalFFT256
 *----------------------------------------------------------------------------
 * Cosim Test Cases - IRQ1 & IRQ2 interrupt interval test
 *----------------------------------------------------------------------------
 * Purpose: calculate 256-pt FFT
 *
 * Inputs:
 *   short *pDat0
 *   short *pDat1
 *   kal_uint16 u2DataStart    :the start idx of data
 * Outputs:
 * kal_uint32* u4FreqData
 * kal_uint32* u4MaxData
 *----------------------------------------------------------------------------
*/
kal_bool ApplyFFT256(kal_uint32 samplerate,short *pData, kal_uint16 u2DataStart, kal_uint32* u4FreqData, kal_uint32* u4MaxData)
{
    kal_uint32 i, u4TmpData;
    
    kal_uint16 u2IdxData, u2IdxStart = 0;
    kal_uint32 u4MagData[4096];
    int i4AvgData = 0;
    
    float dFreq_Idx = (float)samplerate/4096;//16000|48000/256

    //1. calculate average value
    for(i=0; i<4096; i++)
    {
        i4AvgData = i4AvgData + pData[u2DataStart+i];
    }
    i4AvgData = i4AvgData >> 8;
    //dbg_print("i4AvgData=%d, u2DataStart=%d\n\r", i4AvgData,u2DataStart);

    //2. apply Hanning window
    for(i=0; i<4096; i++)
    {
#ifdef Hann_Window
        rComData[i].real =(float)((pData[u2DataStart+i]-i4AvgData)*HanningWindow[i]);
#else
        rComData[i].real = (float)(pData[u2DataStart+i]-i4AvgData);
//dbg_print("[%d] pData: %d\t",u2DataStart+i, pData[u2DataStart+i]);
//dbg_print(" before DIF_FFT[%d] real: %f\t", i, rComData[i].real);
#endif
        rComData[i].image = 0.0;
//dbg_print("image: %f\r\n", rComData[i].image);
    }

    //3. do 256-pt FFT
    DIF_FFT(rComData, 12);

    //4. calculate magnatude
    for(i=0; i<2048; i++)
    {
        //dbg_print(" [%d] \t", i);
        //u4MagData[i] = CalSquare((kal_int32)round(rComData[i].real), (kal_int32)round(rComData[i].image));
        //Avoid overflow calculate the square after right shift 8 bit
        u4MagData[i] = CalSquareRS8((kal_int32)round(rComData[i].real), (kal_int32)round(rComData[i].image));
//        dbg_print(" [%d] %d\t, [real] %f\t, [image] %f\r\n", i, u4MagData[i], rComData[i].real, rComData[i].image);
//        dbg_print(" [%d] %d\r\n", i, u4MagData[i]);
    }

    //5. calculate the frequency
    u2IdxData = u2IdxStart;
    u4MaxData[0] = u4MagData[u2IdxStart];
    for(i=u2IdxStart+1; i<2048; i++)
    {
        u4TmpData = u4MagData[i];
        if(u4TmpData>u4MaxData[0])
        {
            u2IdxData = i;
            u4MaxData[0] = u4TmpData;
        }
    }

    u4FreqData[0] = u2IdxData*dFreq_Idx;
    u4FreqData[1] = u2IdxData*dFreq_Idx*2;
    u4FreqData[2] = u2IdxData*dFreq_Idx*3;
    u4MaxData[1] = u4MagData[u2IdxData*2];
    if(u2IdxData*3 < 4096)
       u4MaxData[2] = u4MagData[u2IdxData*3];

    //dbg_print("1st Idx=%d, u4FreqData[0] =%d, u4MaxData[0] =%d\n", u2IdxData, u4FreqData[0], u4MaxData[0] );
    //dbg_print("2nd Idx=%d, u4FreqData[1] =%d, u4MaxData[1] =%d\n", u2IdxData*2, u4FreqData[1], u4MaxData[1] );
    //dbg_print("3rd Idx=%d, u4FreqData[2] =%d, u4MaxData[2] =%d\n", u2IdxData*3, u4FreqData[2], u4MaxData[2] );
    return fft_true;
}


kal_bool FreqCheck(kal_uint32 u4TargetFreq, kal_uint32 u4FreqData)
{
    double dDiviRange = 0.05;
    kal_uint32 u4LboundData, u4UboundData;

    u4LboundData = u4TargetFreq*(1-dDiviRange);
    u4UboundData = u4TargetFreq*(1+dDiviRange);

    if((u4FreqData < u4UboundData) && (u4LboundData < u4FreqData))
    {

#ifndef Calc_Boundary
        //dbg_print("Frequency Pass!! %d Hz < %d Hz < %d Hz\n", u4LboundData, u4FreqData, u4UboundData);
#endif
        return fft_true;
    }
    else
    {
        //dbg_print("Frequency Fail!! %d Hz X %d Hz X %d Hz !!!\n", u4LboundData, u4FreqData, u4UboundData);
        return fft_false;
    }
}

kal_bool MagnitudeCheck(kal_uint32 u4LboundMag, kal_uint32 u4UboundMag, kal_uint32* u4MagData)
{
    kal_bool bResult = fft_true;
    float fTHD2 = 0.0, fTHD3 = 0.0;
#ifdef Calc_Boundary
    //dbg_print("Magnitude\t %d\t,",u4MagData);
#else
//Main magnitude
    if((u4LboundMag < u4MagData[0]) && (u4MagData[0] < u4UboundMag))
    {
        //dbg_print("Main Magnitude Pass!! %d < %d < %d\n", u4LboundMag, u4MagData[0], u4UboundMag);
    }
    else
    {
        //dbg_print("Main Magnitude Fail!! %d X %d X %d !!!\n", u4LboundMag, u4MagData[0], u4UboundMag);
        bResult = fft_false;
    }
    fTHD2 = (u4MagData[1]==0)? 100000:  ((float)u4MagData[0]/u4MagData[1]);
    fTHD3 = (u4MagData[2]==0)? 100000:  ((float)u4MagData[0]/u4MagData[2]);
    if(fTHD2 > 10000)
    {
        //dbg_print("2nd Magnitude Pass!! THD2 = %d\n", u4MagData[1]);
    }
    else
    {
        //dbg_print("2nd Magnitude Fail!! THD2 = %d\n", u4MagData[1]);
        bResult = fft_false;
    }
    if(fTHD3 > 10000)
    {
        //dbg_print("3rd Magnitude Pass!! THD3 = %d\n", u4MagData[2]);
    }
    else
    {
        //dbg_print("3rd Magnitude Fail!! THD3 = %d\n", u4MagData[2]);
        bResult = fft_false;
    }


#endif
    return bResult;

}

static kal_uint32 CalSquare(kal_int32 i2Real, kal_int32 i2Image)
{
    kal_uint32 u4Sqr, u4SqrR, u4SqrI;
    //u4Sqr =( i2Real*i2Real) + (i2Image*i2Image);
    u4SqrR = i2Real*i2Real;
    u4SqrI = i2Image*i2Image;
    u4Sqr = u4SqrR+u4SqrI;
    //dbg_print("%d\t=\t%d+%d=\t(%d)^2+\t(%d)^2,\n", u4Sqr, u4SqrR, u4SqrI, i2Real, i2Image);
    return u4Sqr;
}

static kal_uint32 CalSquareRS8(kal_int32 i2Real, kal_int32 i2Image)
{
    kal_uint32 u4Sqr;
    kal_int32 i2RealRS, i2ImageRS;
    i2RealRS = i2Real>>12;
    i2ImageRS = i2Image>>12;
    u4Sqr = i2RealRS*i2RealRS + i2ImageRS*i2ImageRS;
    //dbg_print("%d\t=\t(%d)^2+\t(%d)^2,\n", u4Sqr, i2Real, i2Image);
    return u4Sqr;
}

